Описание:
"Набор посуды, 2 пр. Материал: нержавеющая сталь 18/10, крышки изготовлены из термостойкого стекла. 
кастрюля - диаметр: 20 см, объем: 3 л; 
кастрюля - диаметр: 24 см, объем: 6 л; 
две крышки. 
Подходит для всех типов плит, в том числе и индукционных. Рекомендации по уходу: пустую посуду не подвергать воздействию высоких температур. Мыть жидким моющим средством без применения абразивных веществ и металлических губок. Можно мыть в посудомоечной машине.
